//JavaScript Document
//公共脚本;单独脚本在页面底部
//导航需要脚本
$(function(){
    var timer = null;
    function lessHei(){
        $('.page-hidden').height(60);
        clearTimeout(timer);
    };
    $('.nav ul li').hover(function() {
        clearTimeout(timer);
        $('.page-hidden').height(560);
    }, function() {
        timer = setTimeout(lessHei,500);
    });
});

//增加cookie统计
$(function(){
    var cook;
    if(!$.cookie('from')){
        //红包判定
        /*$('.redbag-bg').fadeIn(0);
        $('.redbag-box').addClass('act');*/
        //增加cookie
        cook = 'onex';
    }else{
        cook = 'shopex';
    }
    $.cookie('from', cook);
    var cooking = $.cookie('from');
    var arr1 = ['ONexnav','onexbanner'];
    var arr2 = ['shopexnav','shopexbanner'];
    var oNav1 = $('.page-header-box a');
    var oBanner = $('.handle-banner ul a');

    if(cooking=='onex'){
        oNav1.each(function(index, el) {
            var oHref = $(this).attr('href');
            $(this).attr('href',oHref+'?from='+arr1[0]);
        });
        oBanner.each(function(index, el) {
            var oHref = $(this).attr('href');
            $(this).attr('href',oHref+'?from='+arr1[1]);
        });
    }else if(cooking=='shopex'){
        oNav1.each(function(index, el) {
            var oHref = $(this).attr('href');
            $(this).attr('href',oHref+'?from='+arr2[0]);
        });
        oBanner.each(function(index, el) {
            var oHref = $(this).attr('href');
            $(this).attr('href',oHref+'?from='+arr2[1]);
        });
    }
});
